import './Header.css';
const Header = () => {
  const Submit = () =>{
    alert('Thank you');
  }
  const type = new Typed('.auto',{
    strings:['Shipping','Cargo'],
    typeSpeed:100,
    backSpeed:100,
    loop:true,
  })
  return (
    <header className="Container">
        <nav className='Navbar'>
            <ul>
                <a href="#"><li>About Us</li></a>
                <a href="#"><li>Contact Us</li></a>
                <a href="#"><li>Services</li></a>
                <a href="#"><li>Payment</li></a>
                <a href="#"><li>Book</li></a>
                <button onClick={Submit}>Order</button>
            </ul>
        </nav>
        <div className = "side">
            <h1>Best<span className='auto'></span></h1>
        </div>
    </header>
  )
}
export default Header;
